import React from "react";

export function SerialNumber() {
  return (
    <form>
      <div className="form-group row">
        <label for="serialNumber" className="col-sm-2 col-form-label">
          Serial Number
        </label>
        <div className="col-sm-10">
          <input
            type="serialNumber"
            class="form-control"
            id="serialNumber"
            placeholder="Serial Number"
          />
        </div>
      </div>
    </form>
  );
}
